import React from 'react';
import Header from './Header';
import Footer from './Footer';
import CallToAction from './Hire';
import './Footer.css';
import './Cv.css';

const Cv = () => {
  return (
    <div>
      <Header />
      <div className="contact-container">
        <h1 className="contact-title">Contact.</h1>
        <p className="contact-paragraph">
          Thanks for visiting!
        </p>
        <p className="contact-options">
          Feel free to contact me to have a brief conversation or to discuss our next steps. You can reach me at <a href="mailto:dalewwarburton@gmail.com">dalewwarburton@gmail.com</a> or connect with me on 
          <a href="https://www.linkedin.com/in/yourusername/"><i className="fab fa-linkedin"></i></a> and 
          <a href="https://github.com/yourusername"><i className="fab fa-github"></i></a>.
        </p>
      </div>
      <CallToAction />
      <Footer />
    </div>
  );
};

export default Cv;
